        Fecha: 3,
        Tipo: '',
      }
    })
      .then((res) => {
        console.log(res);
      })
      .catch((error) => alert(error));
  };

  return (
    <div className="container">
      <div className="box">
        <Form onSubmit={handleSubmit}>
          {db.map((data) => (
            <Form.Group className="mb-3" controlId="formBasicEmail">
              <Form.Control type="text" value={data.Concepto} />
